import { combineReducers } from "redux";
import nodeBuilderReducer from "../screens/nodeBuilder/services/nodeBuilderReducer";
import spaceReducer from "../screens/space/services/spaceReducer";

const rootReducer = combineReducers({
  nodeBuilderReducer,
  spaceReducer
});
export default rootReducer;
